import React from 'react';
import { NavLink } from 'react-router-dom';

export default function Nav() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: 'black' }}>
        <div className="container-fluid">
          <NavLink className="navbar-brand" to="#">
            <img src="/1.jpeg" alt="Logo" width="30" height="24" className="d-inline-block align-text-top" style={{Te}}/> DOCTOR BOOKING
          </NavLink>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <NavLink className="nav-link" to="/Doctor-Stats">
                  Doctor-Stats
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" aria-current="page" to="/Bookings">
                  Bookings
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Total-Earnings">
                  Total-Earnings
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Doctor-Earnings">
                  Doctor-Earnings
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Top-10-Doctors">
                  Top-10-Doctors
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Services">
                  Services
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/EarningsByServiceCategory">
                  Earnings-By-Service-Category
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Table-data">
                  Table-Data
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/Register">
                  Login
                </NavLink>
              </li>
            </ul>
            {/* <form className="d-flex" role="search">
              <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
              <button className="btn btn-outline-success" type="submit">
                Search
              </button>
            </form> */}
          </div>
        </div>
      </nav>
    </div>
  );
}
